import { exampleData } from "../../Data/list";
import { monthAvarge, monthCost } from "../../Data/float";
import { yearMonthData, DataSorting } from "./onYearDataSorting";

export function CalculateMonthAvarge(){
    DataSorting()

    for (let i = 1; i != 13; i++){

        var totalCost = {amount:0, count:0}
        var totalIncom = {amount:0, count:0}

        for (let a = 0; a != yearMonthData[i].length; a++){
            if (yearMonthData[i][a].state === "Einkommen"){
                totalIncom = {amount: totalIncom.amount + parseFloat(yearMonthData[i][a].amount).toFixed(2), count: totalIncom.count + 1}
            }
            else{
                totalCost = {amount: totalCost.amount + parseFloat(yearMonthData[i][a].amount).toFixed(2), count: totalCost.count + 1}
            }
        }
        console.log("Monat:" + i)
        console.log(totalCost)
        console.log(totalIncom)


    }
}
